import React from 'react';
import { Form, Button, Col, Row, Container, Stack } from "react-bootstrap";

function Home() { 
    return (
        <Container fluid>
            <h1>Triangle Problems Practice Tool</h1>
            <Stack gap={2} className="col-md mx-auto">
                <Button>Practice sin/cos/tan Problems</Button>
                <Button>Draw</Button>
            </Stack>
            
        </Container>
    );
};

export default Home;
